verse: MAT.012.009
translations:
  kpx-kpx: Iesuu kateaito bulu ke halei dubuiabe moleve tinu.
  okv-H: Eto Iesu na degi avo toto God ta pari ari bande ta horena.
  tbo-tbo: Yesu i nae po hai numa tapalolo uyahina i lui,
  mal-C: ആ സ്ഥലത്തുനിന്നു പുറപ്പെട്ട് അദ്ദേഹം യെഹൂദപ്പള്ളിയിൽ ചെന്നു.
  grc-SR: Καὶ μεταβὰς ἐκεῖθεν ἦλθεν εἰς τὴν συναγωγὴν αὐτῶν.
  bgc-bgc: ओड़ै तै चालकै वो उनके आराधनालय म्ह आया।
  khz-khz: Iesu na vokapu eraokwaniato, eagoto, Iuda talimara geria rupu ai elaka-togato,
  deu-TKW: Und er gieng weiter von da und kam in ihre Synagoge, und siehe,
  zsr-NT: Niꞌr buzë́ꞌë niꞌ Jesús, atiꞌ gyaziëꞌ lu yuꞌu ga tuꞌdubëꞌ tuꞌsëdëꞌ queëꞌ
    Dios bönniꞌ judío.
  lin-lin: Sima na Yesu kolongwa na esika yango, akendeki na ndako na bango ya mayangani
  hns-NT: Tab Jiesoe hoewa se tjal gail aur partjaar ke ghar me gail.
  noa-E: Mag trigodö ee fariseonaan dʉ̈i ijẽjẽb sĩewi petaau, aigmua dakha maach meeun
    Ẽwandam iek jaaujem di sĩerr ee dubimajim.
  eng-EMTV: And having departed from there, He went into their synagogue.
  mib-NT: Yūcuán na te cuahān Jesús, te ni quɨ̄vɨ ya ini vehe iī sinagoga.
  lif-NT2: ये़सुःन् खे़प्‍मोलाम् पेआङ् यहुदि चुम्‍लुङ्‌हिम्‍मो लाःसे़॥
  xnj-xnj: Yesu akawuka penapo, akahamba munyumba ya kukonganekela Vayawudi.
  mmx-mmx: Iesu ga vas kaxat basinge mo loxot la ga vubeles uto at loogu singising
    atdi.
  cbr-NT: Anuax cuanx ca Jesús anua judíos unicama timë́ti xubunu cuani atsíancëxa.
  tee-NT: Pus ju Jesús taxtucha ju anch. Milh la'ixpujitat'an ju ist'a'israelitanin.
  eng-LSV: And having departed from there, He went to their synagogue,
  cak-NT: Y cuando ri Jesús y ri ru-discípulos xetzolaj-pe, xebe pa sinagoga, ri jay
    anchi' niquimol-wi-qui' ri winak chi niquic'oxaj rutzij ri Dios.
  pah-NT: Aerẽ Jesus'ga hoi ogwovo gwe'yja'g̃a jatykai pe ovahema.
  sja-NT: Mamãik'aapa Jesús wãji Tachi Ak'õre Ũraa jarateepata tedee.
  xed-xed: Ka sliʼaftá Yesu ka zlaŋtá tsa vli ya, ka laghwi da həga tagha skwa la
    Yahuda.
  mks-NT: Tá na̱ndihi já na̱quee Jesús cua̱ha̱n já na̱ndi̱hvi a veñu̱hu mé ñuu cán.
  gfk-S: Io, Jisas ga hana talur ikino katano, igom hana lala ter tano nudi hala na
    lotu ira Iudeia.
  bmu-bmu: Jisösnöŋ miri mi mosöta köuluk miriŋine öŋgöyök.
  dgz-dgz: Iesu at ame ae ve, amba iup anuine paewa gwanap unuk aen.
  eng-GNV: 'And he departed thence, and went into their Synagogue:'
  zaa-NT: '@see-verse:MAT.012.008'
  eng-WEBSTER: And when he had departed thence, he went into their synagogue.
  guh-guh: Trigo pabianëjavata Jesús livaisi petsipaebicujinae fariseovijavabelia,
    Jesús baja vecuapona pabianë. Nexata Jesús joneya judíovi penacaetuatabiabiboyalia.
  bon-bon: Yeesu pui cewe ne sebmalige, ädige, yepä abasecretna mete cabu me abacitige.
  nhw-BL: Jesús quistejqui nepa huan yajqui inintiopa.
  swh-ONEN: Yesu akaondoka mahali hapo, akaingia ndani ya sinagogi lao,
  wbi-wbi: UYesu akavuuka pala, akaluta na kukwingila mu sinagogi jino jaale mu kikaaja
    ikio.
  bba-bba: Mɑ Yesu doonɑ min di, u duɑ ben mɛnnɔ yerɔ.
  eng-KJVCPB: 'And when he was departed thence, he went into their synagogue:'
  kgk-NT: Upe-gwi Hesu ohasave oho-vy ojeporahéi haty-py oike oho-vy.
  waj-waj: Yisuuva itaa kua kiaa taika kioo ivau iya pikioo ngiari nuunaira nnauvaki
    viravai.
  cpy-cpy: Opoñaashita rawijanaki Jesús, kyaapaaki ipiyota-piinteetaha.
  ekk-PKP: Siis Jeesus lahkus ja läks nende sünagoogi.
  mpx-mpx: Yeisu i nawanawa al i na i ulutuk panuwa o wali limi tapwalolowa.
  wbp-wbp: Jijaji yanurnu pina jaaji-kirra Juwu-kurlangu-kurra.
  luo-luo: Kane omedo dhi nyime koa kanyo, nodhi nyaka ei sinagogi,
  nhe-NT: Jesús quistejqui nepa huan yajqui inintiopa.
  aii-aii: ܘܫܘܼܢܹܐ ܠܹܗ ܝܼܫܘܿܥ ܡ̣ܢ ܬܵܡܵܐ، ܘܐܬܹ‌ܐ ܠܹܗ ܠܟܢܘܼܫܬܵܝܗ‌ܝ.
  esk-NT: Jesus tavrakŋa aullaqami isiġniqsuq Jew-ŋuruat katraġviatnun.
  msb-msb: Paghali didto nagpakadto si Jesus sa inda sinagoga.
  cpa-NT: Jøng² ca¹ŋó¹ Jesús. Ca¹hí¹dsa dsi²néi² guøh¹² quiah¹² dsa² chian² ja³jøng².
  dso-dso: ଜିସୁ ସେ ଜାଗାଇଅନି ବାରଇ ଜାଇ ପାର୍‌ତନା ଗରେ ପୁର୍‌ଲା ।
  meu-meu: Ia na unu amo e raka oho, bena edia dubu ai e dae kau.
  yva-NT: Yesus pusyo, umba to siso no yavaro sambaya inta ama uga.
  dgc-dgc: Nadid, hinumektat sa ti Jesus, a inumange to kapilya de a esa.
  zpm-NT: Bded ga, goḻ stib dze ne rdziiladz zho lo dziina, güey Jesús leṉ yadoo win
    ne zob lad guiedz co.
  hix-NT: Tàwya Farysew komo hananàhàtxhe rma, toy hatà, Txesusu. Ohsamnohno ytxoho
    ro yaka nowomye hatà.
  sim-sim: Ushihi Jisas yanga oson or halaha Judama lotu undari akak ormu layira.
  npi-ULB: त्यसपछि येशू त्यहाँबाट अलग्गिनुभयो र तिनीहरूका सभाघरहरूमा जानुभयो ।
  cgc-cgc: Pagtapos Jesus ta isturya naan ta mga Pariseo ya, gapadayon kanen i ta
    iya na pagpanaw daw gaselled naan ta balay tipunan na naan dya mga Pariseo na
    ya gasimba.
  tim-tim: Akto Yesuŋe arewa arim yâk yeŋgât den emetŋân âgâep.
  yor-yor: Nígbà tí Jesu kúrò níbẹ̀ ó lọ sí Sinagọgu wọn,
  wos-wos: Wun hundi wataka dé Jisas wun hafwa yatakataka dé Godna hundi buléndaka
    geré wulayi.
  emp-NTPO: Jesura mamaʌba judiorã dji jʌrebada ded̶aa wãsia.
  eng-F35: Now moving on from there He went into their synagogue.
  ind-ind: Lalu Yesus meninggalkan tempat itu dan masuk ke salah satu rumah pertemuan
    orang Yahudi.
  pes-OPCB: آنگاه عیسی به کنیسۀ آنها رفت،
  mpt-mpt: Yesuse deibenea monea Gode amo tem tam temea
  bla-bla: Ota'atsĭstapusi, otatoi'apioyimoai itsipim;
  ssx-ssx: Yesuma꞉ koto pa꞉ta꞉ mina꞉pa꞉lao pulu hata꞉ mo Diu haliwekina꞉ yeni peao
    haemeke da ma꞉nda꞉ tukiki pa꞉ta꞉ honda꞉ pambaata꞉
  mkl-mkl: Nɔ Jesu í nɛ hɑi bɛ í koo í lɔ ile bii Zuifu ŋɑ ɑ̀ yɑ ce kutɔtɔɔu.
  gaq-gaq: ଜିସୁ ଆତେନ୍‌ ଜାଗା ବାନ୍ ୱେଚେ ପାର୍‍ତନା ଡୁଆ ବିତ୍ରେ ଗାଗେ ।
  gof-RNT: Yesuusi yaappe bidi Ayhude Woosa Keethi gelis.
  unx-unx: ୟୀଶୁ ଏନ୍‌ ଠାୟାଦ୍‌ ବାଗିକେଦ୍‌ତେ ସାମାଜ୍‌ ଅଡ଼ାଃତେ ବଲୟାନା ।
  gah-gah: Láa loake, nenelotí oteake vike monó numuni makokú nene itimó.
  lcm-lcm: Au, kala papelek a ring ang na kanla palak nei kari lu i kivung,
  aer-aer: Yanhe-ngentyele anteme Jesus arrpenhe areyele-arlenge apmere ikwerenge-ntyele
    alheke imerte tyatye Jew areye-kenheke irrpemele. Arrernelheke-arle iperre itne
    kweneke irrpenherlte-iweke.
  qvc-NT: Jisusqam chay kashqayllapamanda rishpa, sinaguga wasiman yaykurqan.
  tgl-ULB: Pagkatapos, umalis si Jesus mula doon at pumasok sa kanilang sinagoga.
  cbs-NT: Jabias juindukunti sábadotian jabia baiwen kai mae betsa anu jikitan jatun
    ichati jiwe medan jikixun Jesúsun jatu yusianyan
  xtm-NTPP: Kua'an Jesús ma, te ni kivi ya ini veñu'u luluu kátuu ñuu de ma.
  nnq-nnq: Yesu ngaboka penia ngajenda kunyumba jabe ji kugongalela.
  bao-NT: To ca niiricʉ waagʉ, tii tabe macã wii, nea poo juu buerica wiipʉ jãa waawi.
  san-ORI: ଅନନ୍ତରଂ ସ ତତ୍ସ୍ଥାନାତ୍ ପ୍ରସ୍ଥାଯ ତେଷାଂ ଭଜନଭୱନଂ ପ୍ରୱିଷ୍ଟୱାନ୍, ତଦାନୀମ୍ ଏକଃ
    ଶୁଷ୍କକରାମଯୱାନ୍ ଉପସ୍ଥିତୱାନ୍|
  huv-NT: Condom Teat Jesús taw quiaj, tamb andüy tiül sinagoga ocueaj nipilan judío.
  otn-NT: Mi̱ ma ra̱ Jesús, i̱ map'ʉ ja rá̱ ni̱ja̱ yø judío.
  nop-nop: Unduŋ yodapmaaŋ nai uŋaniŋgoŋ wooŋ Judahi’walaŋ bopyotneŋ foguk
  obo-NT: Na mid tanan si Disas dutun, woy id undiyon sikandin to simba-an to mgo
    Judio.
  cak-ENT: Y tok ri Jesús y ri rachibila' xetzolij yan c'a pe, rije' xebe pa jay ape'
    ntzijos-vi ri rutzij ri Dios.
  lif-NT: ᤕᤧᤛᤢ᤺ᤴ ᤂᤧᤵᤔᤥᤗᤠᤶ ᤐᤣᤀᤠᤱ ᤕᤜᤢᤍᤡ ᤆᤢᤶᤗᤢᤱᤜᤡᤶᤔᤥ ᤗᤠ᤺ᤛᤧ॥
  mie-NT: Ñúcuán de cuāhān Jesús, de nī nquīvi yā inī vehe īī sinagoga.
  san-TIB: ཨནནྟརཾ ས ཏཏྶྠཱནཱཏ྄ པྲསྠཱཡ ཏེཥཱཾ བྷཛནབྷཝནཾ པྲཝིཥྚཝཱན྄, ཏདཱནཱིམ྄ ཨེཀཿ ཤུཥྐཀརཱམཡཝཱན྄
    ཨུཔསྠིཏཝཱན྄།
  qve-NT: Chaymanta rishaspanmi Jesusqa Diosmanta yachachina sinagoga wasiman haykuran.
  pao-NT: Onona mease soo Te Pabe'e ka mu nanesootuhidu-baa petuga.
  cbu-NT: Anumunsha Isussha naateeru, yuwash Utaáshuch Apanlleem shaniykana anush
    pshturangiya.
  usa-usa: Îtuma min-áúkápáqá yuwéna yeqtí monoq-náúpáq uráiye.
  soy-soy: Yeesu uu kei yisi uu tɔ́mpɔ uú hɑ pikuyomɛyɑ́hɑɑlee loni.
  hui-hui: Yasu ibu dindi ogoni wahalu puwa ngoai hagane anda mbiraha pene.
  amf-amf: Yesus ogora dhaabhayse Ayiwd eensa bukin raqinte ki ardade.
  quc-NNT: Xel k'u b'i ri Jesús chila', xok b'i pa jun chke ri rachoch Dios ri käkimulij
    wi kib' ri winaq.
  dob-dob: Gote ꞌenega Yesu ꞌitauya ga ꞌidi Anuwa Tapwalolo ꞌena ꞌilugu.
  wrs-wrs: Yesusva nominiva venamba, wo sembayangduvra siha, mongova indhanariniva
    doara di avna, henamba englava doara heva doa vendpethamnana, no mungil avna.
    Varisinindva doara di lovahna, wo hev umnina Yesusm, es yimba nengv, es hevpa
    yimba lehra sishona vrevavma indhanarinimba hona vah iaevul okombanamba? Himba
    ambo dasalm umnivna Yesusmba, doara doa himba hevmba ishuvna, osva Yesusva hona
    indhanarinimba sishona vretava detiva, ata pimba Yesusmba wetat uvav kuwulinda
    osva, Yesusva doa pilpikoheini lohohmomba pinamba.
  mca-mca: Ha' Jesús in hats t'atsji'ƚik'uifik'i ha' wit'enekju' qa ikii qa uyifi
    ke' judiol ƚe'lijtsitjii.
  tzo-TZC: Ti Jesuse tey ilocꞌ batel, iꞌoch ta chꞌul na.
  mya-mya: ကိုယ်​တော်​သည်​ထို​အ​ရပ်​မှ​ကြွ​တော်​မူ​၍ တ​ရား​ဇ​ရပ်​တစ်​ခု​သို့​ဝင်​တော်​မူ​၏။-
  gng-NT: Tɔ, *Yesu siere' niʼsaan, nɛ ki kɔn' biʼtaanl ya duku ni.
  cbi-NTPO: Jesús junu malu' miitu, chachilla' waku wakudinu yashaa vimi.
  ikk-NT: Jesu nọ gha ebahụn pụ, banye ụlọ-ofufe wẹ.
  leu-leu: Na Yesus a taꞌulan a bina pave e laak lana lifu ina faxuvulan siri
  maz-NT: Cjanu o mbedye c'ua e Jesús nu, o ma cja c'ü o̱ nintsjimi anguezeji.
  bod-N: དེ་ནས་སྐྱབས་མགོན་ཡེ་ཤུ་ཡུལ་དེ་དང་ཁ་བྲལ་ནས་ཁོ་རྣམས་ཀྱི་ཆོས་ཁང་དུ་ཕེབས༌ཤིང༌།
  tca-NT: Rü yexguma yema nachicawa ínaxũũxgu ga Ngechuchu, rü guma ĩãneãrü ngutaquẽ́xepataü̃gu
    naxücu.
  zpl-NT: Chenu ulaxu nú udete Jesuse zeꞌe uyuꞌunu liñi indu nú nzucu enza zeꞌe.
  mbc-NT: Jesus epa'ka'pî miarî pai moropai attî'pî to' epere'to'kon yewî' ta.
  ndg-ndg: Yesu gabuka palo gayenda kuhekalu lyabe, linga kwabi na mundu mlemafu wa
    luboko Mafarisayo ngaba naluya Yesu, kababaya,
  wsk-wsk: Jesus kuwim umu beteram ale nama nunga synagogue ningi kasu naguram.
  toj-NT: Ja Jesusi ti xa huaja. Ti och ja ba yiglesia ja mismo judio jumasa jahui.
  tbc-tbc: Jesus aben an ibiseig yaug, taun ta siŋiren na ilasag, iŋsad ubou ab lo
    iladu ya.
  sna-sna: Achipfuurira mberi kubva panzvimbo iyoyo, akapinda musinagoge ravo,
  smk-NT: Linmakwan yadtaw si Jesus tan nako ya sa sinaguga radtaw nin Judio.
  grc-TCGNT: Καὶ μεταβὰς ἐκεῖθεν ἦλθεν εἰς τὴν συναγωγὴν αὐτῶν.
  gof-WFTW: Yesuusi yaappe bidi Ayhude Woosa Keethi gelis.
  spa-BLM: Salió de allí y entró en la sinagoga de ellos.
  kyz-NT: '''Gã nupe oporogytapaw ire Jejui ''ga awau osou judeu ''gã jatykaaw ipe.'
  dao-dao: Jesuh acun üngka naw cit lü, ami sinakoka lutki.
  cya-cya: Ña'aan mdo'o ñi can' mdiyaa ñi se'en n'ni tnu ne' 'in Ndiose.
  wrk-wrk: Kamu barri yingkijbayi nanda yaji Jisuswanyi, baki mili jilajba nyuli,
    baki wanbiya nyuli barrawuyabarrawuyana, baki ngankijba nyuli jurjina nanaba.
    Bayakarda nanda jurj.
  nii-nii: Jiisas konu ełe si kindpi, men ngii ełe tuk pum.
  ign-NT: Te apana­varepa sávaru, tiyanavare ema Jesús tisiapahi tayehe eta náuruji­si­rareva.
  dik-NT: Naɣɔn aköl dɛ̈t ke Jethu jiël tënë awën ku ler tɛ̈n amat kɔc Itharel,
  cac-cac: Ix lajvi chi', ix b'at Jesús, ix c'och d'a yol spatil sculto eb' vin̈.
  tzj-E: C'jara' xel ela Jesús y xba, xoca chpam jay rxin molbal ri'il cxin aj fariseo.
  bpx-bpx: अने अळतेण ईसु तां गेथो अगो ज्‌यो, अने भगवान ना भक्‌ती ना घोर मे ज्‌यो।
  san-BUR: အနန္တရံ သ တတ္သ္ထာနာတ် ပြသ္ထာယ တေၐာံ ဘဇနဘဝနံ ပြဝိၐ္ဋဝါန်, တဒါနီမ် ဧကး ၑုၐ္ကကရာမယဝါန်
    ဥပသ္ထိတဝါန်၊
  yaa-NT: Nãskata Jesús nãnoax kaax judeofãfe ãto ichanãti pexe mẽra ikitoshini.
  cab-NT: Ába lídin Jesúsu ñígiñe, ába lebélurun tídoun jalígilisin juríu.
  clu-clu: Pagkatapos dato nagalin dayon si Jesus doto kag magayan sa isara sa anang
    mga simbaan ang mga Judio.
  swh-ULB: Kisha Yesu akatoka pale akaenda katika sinagogi lao.
  tpt-NT: Ex taxtulcha ni Jesús, va al laqa chaqaꞌ taꞌan ixtataqxtoꞌa ni israelitas,
    ancha tanuchal.
  aai-aai: Jesu nati efan itumar na hai Kou’ay Bar ta wananwanan run,
  sny-sny: Sosu a'i pe Jisas awei ape arunatiyewe, ta'uweyei wesi lowe lo papu wiye.
  myy-myy: Ito yija bero judio masa minijuari wijʉ wacõri sãjacʉ gʉa Jesús rãca.
  trc-NT: Ga̱a ne̱ curiha̱nj Jesucristó rej na̱j naa̱ yoꞌ, ne̱ catúj soꞌ rá veꞌ tucuꞌyón
    nij síí ma̱n chumanꞌ yoꞌ se‑tucua̱nj Moisés a.
  cut-NT: Chuh Dihvo vo min, ne chenda̱ ye chete a̱ma ya̱co yahn ihyan nación yahn
    Israel.
  bel-bel: І перайшоўшы адтуль, увайшоў Ён у сынагогу іхнюю.
  zlm-KSZI: Isa beredar dari situ lalu pergi ke sebuah saumaah.
  gdr-gdr: Ɨ Yesu ɨtemb pɨpmet yɨraronj dɨde ket b'ɨgaronj onggɨt Parisai rɨga waina
    yɨr opmitenapu met wa.
  vmy-NT: ꞌBa ꞌbatsaꞌen Jesús jaꞌasꞌen niꞌya sinagogare nchjabiu.
  cmn-FEB: 然后耶稣离开，来到他们的会堂。
  gmv-RNT: Heeppe izi gede aadhdhishe Ayhudata Woosa Keeththan gelides.
  ncl-NT: Huan quiman mohuicaya, calaquic pa inmintiopan capa momaxtiloaya Dios ilajtol.
  sua-sua: E Yesus thera parem a loot to endo, to kvaik kun mnam o Yuda ngarta rek
    langto kam rere mnam.
  are-are: Anparantama lhamala, Jesuanha synagogue etnakanhurnantama irrpuka.
  gai-gai: Karica Iesusa an taup tɨkcarica ma taŋga mina Iudananta mimitpac aŋgɨrena
    kac mambukat.
  qvm-NT: Tsaypita aywar Jesús yaycorgan tsay marcacho sinagogaman.
  chz-NTPS: Yaꜙhë̱ë̱ꜗ Jesús jeeˊ ja̱ˉ, ngooyꜗ mahꜗ gaꜙheyꜗ nehꜙ gwahꜙ mähˉ kihꜗ dsaˉ
    judiu.
  kmu-kmu: Ani kumala neꞋataleno mono nopi haino maine.
