  quf-NT: Jesusqami chaymanta rirqa, chay tantakananllapa wasiman yaykuran.
  yuw-yuw: Yesu yu sa wo imun fauna Yuda nanohon fatmata yocyoc bucin ögoc.
  hus-NT-1971: Taley cale a Jesús taja’ ani otsits tin tiyopanil an Israelchic.
  med-med: Jisas ik nimba, murum kona ni wak ropa, mba manga wingti kel tila, murʉk
    purum ila, wu ti ki orunga, kuⱡpa kel etʉm wu ti murum. Manga ila wamp mat, Jisas
    uⱡ ⱡawa mat enim, Jisas kʉn nimbun ndil ndil poⱡʉp nʉmin nʉk pilik morung nimbʉ
    ndi, Jisas waldʉk nʉk mel, “Mowi kor ei kʉn, wamp etpa ti uⱡ ei, Moses nga mi
    ik ei ndi, mon nʉtʉm uⱡ ei etmin ei, kapⱡa muna mon?” nʉtʉng.
  bch-bch: Iesus itnan tibur toa oa ta ila idudunga ngan led luma ede raring aea.
  cco-NT: Jo̱ mɨ˜ cangɨ́ˋ jo̱, cangóˉ Jesús fɨˊ co̱o̱ˋ dsíiˊ sɨnʉ́ʉˆ guáꞌˉ quiáꞌˉ
    dseaˋ góorˋ dseaˋ Israel.
  deu-1951: Und er ging von dort weiter und kam in ihre Synagoge.
  alq-ALGNT: Jesos dac ki odji madja iima, acitc Coda8inni aiamiemigi8amikag ki ija.
  ixl-NNT: Tul maꞌtik ipal u Jesús kꞌatz unqꞌa trigo, as ok veꞌt Aak tu u atinbꞌaleꞌ
    tetz nachbꞌal Tiixh.
  boa-NT: Átsihdyúu dííbyema muha méúcaavé téjcoojɨ pihcyáávéjá pañévu.
  etr-etr: Amila awälahilä, Yesu e ilile gedolo mosö afädë neebea ami nogila digai.
  quh-NT: Chaymanta ripuspataj Jesuska tantacunawasincuman yaycorka.
  kwi-kwi: Suas Jesúsne tas ɨt kit pɨpulura piannat kit Judío kammu yalta napta.
  agm-agm: Sapɨhɨ Parisihiyai saundamapɨ Jisaasiho kiyaamɨ (sinekokɨhandɨ) aŋaaŋɨ
    pɨwɨhaapɨ ahoyanohɨtɨhandaatɨhɨ notɨ nandaataise.
  ubr-ubr: Iesu on efan ikirir ato inai au bayoi goa,
  tsw-NT: A̱vu Yesu ꞌyon, reve u uwa a̱tsuma̱ a̱ a̱a̱ꞌisa̱† a na a̱ ri lo zuzu.
  cax-NT: Auqui arrti Jesús sürotitü auquimanu. Sürotipo au manu porrü sinagoga.
  aia-aia: '''Ia Jisas ''a hano baaniai dorasi ma siri na''i rumani ha''arahesi adaaui
    Jiu.'
  srp-1865: I otišavši odande doðe u zbornicu njihovu.
  agt-agt: A ta kabalinan na kumanen a nagtatugut ig Hesusen, te e kid na ta kapilya,
    a simarok kid.
  lug-lug: N’avaayo n’ajja mu kuŋŋaaniro lyabwe.
  yby-yby: Loko lokoko yaloti maya sinoko woko monoka numuda makomauya yowiye.
  heb-heb: ויעבר משם אל בית כנסתם׃
  mpp-mpp: Aime ye hegilelu iwacni hikelu kpakpaduc macnginang fewec.
  apb-apb: Oto a Jisas e uure mwaanie leune ko si lae hunie ngaeta nume ni palo-palo,
  san-TEL: అనన్తరం స తత్స్థానాత్ ప్రస్థాయ తేషాం భజనభవనం ప్రవిష్టవాన్, తదానీమ్ ఏకః
    శుష్కకరామయవాన్ ఉపస్థితవాన్|
  ben-IRV: পরে তিনি সেখান থেকে চলে গিয়ে তাদের সমাজঘরে প্রবেশ করলেন।
  ntu-ntu: Jiszs rlaszle mrlcde, x sc tqvztrpe mz mangr-nzkrka'ngr nyzdr Farzsi lcng.
  pan-pan: ਫਿਰ ਉੱਥੋਂ ਤੁਰ ਕੇ ਉਹ ਪ੍ਰਾਰਥਨਾ ਘਰ ਵਿੱਚ ਗਿਆ।
  tkr-tkr: I'sa mançe sinagogeeqa qarayle.
  gvc-gvc: To ã niri baharo waha, judio masa mari buheri wʉhʉpʉ sʉi sã Jesu mehne.
  mwp-mwp: Kalanu nuy uzaraydhin moegina yoewthoepa, nubiya kalmel nungu niyaykazil.
  ksj-ksj: Ebu Iesuꞌa eꞌe haba modadu zeḡe nuꞌonuꞌo neḡa diuḡiro.
  sbk-sbk: Tena Uyesu asogola pala abhala hushibhanza shawo.
  mya-JVB: ထို အရပ်မှ ကြွ ၍ တရားစရပ် သို့ ဝင် တော်မူ၏။ လက် တစ်ဘက်သေ သောသူ တစ်ယောက်ရှိ
    သည်ဖြစ်၍၊
  kgf-kgf: Imuhuc ʒéma baec imuacnec kemma tocgotocgo amaginaiguc eŋec.
  awb-awb: Sísaga mitaq suena Asiu kené momiwí nahtápéq kibekúwana
  gdn-gdn: Iyesu tawa ki kamadubu manako kayawena guriguri tawai mo yapu.
  nko-NT: Yesu lɛ́natɩ́ ɩnʋ, ɔlɔyɔ Yudafɔ ofíakpa.
  bsn-NT: To yi vacʉne, Dios ocare ĩna buerivijʉ yʉare ũmato sãjacami Jesús.
  pib-NT: Wane yiyatka. Wanna ginkaklewawaklepji yatka.
  wiv-wiv: A Iesus e vatia palaka kua, ia vano hoho na haus lotu ke vuni Iuda,
  reg-reg: Neya Yesu nasokao nagenda mulikofyanyisho lyebhwe.
  mlh-mlh: Yesuji moreŋ oi bokeru oŋgawowosi piyaŋuŋgo ropeya.
  gof-ENT: ዬሱሲ ያፔ ቢዲ ኣይሁዴ ዎሳ ኬ ጌሊስ።
  aau-aau: Enekwei sohokwe sawk Jisas hiykwe kipay sehe lokriy hain nok, sawk Juda
    mo hokruw-a kamon mon hiy-yawriy.
  tvk-tvk: Di, Iesu e moletin nan xil labe reling rute ak e labe nim te pispisienna
    Farasi xil ak.
  prf-NT: Káttapos ay lummakad ti Jesus sakay ummangay siya ten sinagoga.
  auy-auy: Ísu mifáꞌá tuwéna ámáán-daumpaꞌo iyúwana
  tbg-tbg: Ihuva vi vatara mini kero oru viro vika maara naavu voqi oru vaura.
  hub-NT: Nuna tusa timatai nina unuinatairi aina Jesúsjai judío aina iruuntai jeanam
    wayawaruiti.
  hmo-hmo: Iesu ese unai gabu ia rakatania, vadaeni edia dubu ta dekenai ia raka vareai.
  big-big: Pulaga Yisu Yudawiligi i walek songono namakke yeke ige la logo
  gux-G: Ki jesu siedi bi kani ki ban kua bi jaadieciangun nni,
  cnl-NT: Ŋóo² co̱'³ Jesús. 'Í² ñʉ'²³ 'ñʉ́² je² mi³gáan³ Dios dsa³ Israel.
  zar-NT: Níʼirö buzë́ʼë Jesús niʼ, ateʼ guyuʼë lu yuʼu ga tuʼdubëʼ bönniʼ judío,
    en tuʼsëdëʼ queëʼ Dios.
  kde-kde: Yesu nkuuka anepo, nkuinjila muing'ande yavo ya kunnyuwila Nnungu,
  ata-ata: Iesu muvivikalaneꞌi ta Palisaio ne mukalu la musuku mulai no tuala vile
    la muꞌunalai no taasou lalotu noxiꞌa ta Iutaia.
  qvw-NT: Chaypïta Jesus pasalmi juntunaculcänan wasiman yaycula.
  nfa-nfa: Èle ka Yesus tèke eele era èèna, laꞌe asa dꞌara èmu sabajꞌa ra.
  tnp-tnp: Kəni Iesu təmiet ikɨn əha, maliuək matuvən əpəha imə e nimə rəha nuhapumɨniən
    rəhalah.
  urd-urd: वो वहाँ से चलकर उन के इबादतख़ाने में गया।
  hot-hot: Yôv ma Yisu hatak buêŋ ma habitak hayô avômalô loŋ êŋ iniŋ unyak yeŋ kapô.
    Ma anyô baŋ hatyôk te hamô loŋ êŋ.
  mqj-NT: Mengkalaomi Puang Yesus untampe angngenan iatoo, anna lu tama mesa banua
    pa'sambayanganna to Yahudi.
  rus-SYN: И, отойдя оттуда, вошел Он в синагогу их.
  mbh-mbh: Lama Jisas i plosa nge rem aken, ma i eso a Judare ole lotuonga a vel omole.
  bdd-bdd: Nage ꞌoinega Yesu ꞌitauya, ma ꞌidi Hada tapwalolo ꞌoina ꞌiluhuwa.
  cbt-NTPO: Ina quëran paantarahuaton, niyontonpiso pëiquë ya'conconin.
  srn-NT: Yesus kmoto fu drape, dan A go na ini a kerki fu den.
  cta-NT: Loꞌo liꞌ nduꞌu Jesús, ndyaa yu xaꞌ quichi̱, ndyatí̱ yu neꞌ laa jiꞌi̱ nguꞌ
    judío cajua.
  bqc-SIM: Kɛ́ Yesu bↄ̀ we, ↄ̃ à gɛ̃̀ ń lousisikpɛu.
  tcz-CHONGTHU: Chutah in Yeshuan akikhop nau in chu ajon paitai.
  mar-mar: नंतर येशूने ते ठिकाण सोडले व यहूद्यांच्या सभास्थानात तो गेला.
  snp-snp: Yesu ya ebawa ya fulito uto mono numunigu idaito,
  isl-isl: Jesús lagði nú leið sína til samkomuhússins.
  spy-NT: Kutas taay ꞉Yēēsu ākoo rubiikyii ākoy kōōto ake nyēbo saayeet.
  xnn-xnn: Nakwas pay di dat komaan si Jesus et omey isnan sinagoga.
  mwe-mwe: A Yeshu gubhashoshile penepo, gubhajinjile nshinagogi jabhonji.
  tte-tte: Yeisu yanuwane ilogabaen yo ilau yanuwa yaboyoi koina kabo ilusae ali nume
    tapwalolo mena.
  tcs-tcs: Apta prom de Zizas i bin lego go po da zuwispreaus.
  hlt-THB: Ce a hyn ce cehta nawh, a mingmih a Sinakawk khuina ce cet hy,
  soq-soq: Iesu mo emone gagalo duwa bedewe odene alen,
  qub-qub: Chaypita aywar Jesús yaycuran chay marcacho caycaj sinagogaman.
  att-att: Á kabalin ni Apu Kesu nakiubobuk sù ira Parisio, nánaw nga minay sù iskuelá,
    nga ággagammungád da.
  bki-bki: Naruei Yesu naio juvan vio na, naio miel bano, ana na naio ba joomo ea
    kialo yimo na volkouano tai.
  bqp-bqp: Kũ Yesu bò gwe, akũ à gɛ̃̀ ń aduakɛkpɛn.
  mcp-mcp: Yésus mú wú na jínɨ kʉ́lʉ́d, a mú kyey kə nyíi *mpáánzə́ minjɨ́ɨ́gʉ́lá
    dɨ̂.
  hat-hat: Jezi kite kote l' te ye a, li antre nan yonn nan sinagòg yo.
  npl-NT: Jesús oyá de ompa iwa okalakito kan se sinagoga.
  bgg-bgg: Isu è ji pha ithua thoh marui ne Jewthek misiahò hà wuii dun.
  eng-TCENT: Then he departed from there and went into their synagogue.
  eng-BSB: Moving on from there, Jesus entered their synagogue,
  cpu-NT: Ipoña jovaanaka Jesús, ikyaapai eejatzi japatotapiintaita.
  san-ASM: অনন্তৰং স তৎস্থানাৎ প্ৰস্থায তেষাং ভজনভৱনং প্ৰৱিষ্টৱান্, তদানীম্ একঃ শুষ্ককৰামযৱান্
    উপস্থিতৱান্|
  tac-NT: '''Lige Esusi uchéchigo bilena simile, simile bilé u''tá re''obá ilígichi
    «sinagoga» anilime.'
  eng-WEBPB: He departed from there and went into their synagogue.
  gfk-H: Io, Iesu ga haan talur iakano sibaan, gaam haan laka taar tano nudiet hala
    na lotu ira Iudeia.
  viv-viv: Tu Yesu faheya amine giꞋela gina yadi manuwa-abavehawala ana egana sinagogi
    againe giluku.
  yao-yao: Nipele, Che Yesu ŵatyosile pelepo, ŵajinjile mu nyuumba ja kupopelela.
  tgp-tgp: Mo malue hin jara atu mo vano mo unu na nora ima lotu ea.
  auc-NT: Äninque wadæ godinque Itota ïñömö Wængonguï angä näni ëñente yewæ̈mongainta
    ate oodeoidi näni odömöincönë go guiigacäimpa.
  kbc-NT: Jesus naɡ̶a noditedice niɡ̶ijo aneite, odaa jiɡ̶igo manitaɡ̶a liiakanaɡ̶axi
    judeutedi.
  bmh-bmh: Yesus uzan go uteimai, go Zuda agal gotulanemen zaueim sieun.
  ctu-BL: Che' bʌ tsi' cʌyʌyob, tsa' majli ti ochel ti sinagoga.
  meq-meq: Yesu a ye abəra ka təv niye, a ye a gay i maɗuwule me.
  noa-H: Mag trigodö hee fariseonaan dʌ̈i hijẽjẽb sĩewi petaau, haigmua dak'a maach
    meeun Hẽwandam hiek jaaujem di sĩerr hee dubimajim.
  alp-NT: Eleki Yesuse Ikeu bei mere kai Ikusu me Yahudiaru esi luma ibada sae me.
  san-VEL: anantara.m sa tatsthaanaat prasthaaya te.saa.m bhajanabhavana.m pravi.s.tavaan,
    tadaaniim eka.h "su.skakaraamayavaan upasthitavaan|
  kbq-kbq: Ananteti Jisasi'a atreno osi mono nozimifi (Sinagok) vu'ne.
  kbh-kbh: Chents̈ana Jesús tojtsanoñe y chents̈a judiëngbe enefjuana yebnoye tojánamashëngo.
  ron-LSB: A plecat de acolo și a intrat în sinagoga lor.
  pon-pon: A kotila jan waja o, ap kotilon on nan ar jinakoke.
  nhe-BL: Jesús quistejqui nepa huan yajqui inintiopa.
  sps-sps: Jisas naus osing a pan naa to aya ana Ya naa fi enato tana isen a numaa
    iny fafaatouf tana taa Jiu.
  wnc-wnc: Siwan Jesuta puya waanga teke unenanatane miti yotnane kopbut.
  nmw-S: Yeisu i dodogan hedi i lok i la i setuk hiyebe yake he wedi guwole tapwalolo.
  bus-bus: Kɛ̀ Yesu bↄ̀ gwe, ben à gɛ̃̀ ń aduakɛkpɛn.
  gub-BL: Na'e uhem Zezuz oho a'e wi urerupi a'e kury. Oroho zemono'ogaw pe kury.
  imo-imo: Kano kinye Jisas aku kombumu tiye kolopa pumbe Juda imboma maku toko Gotenga
    ungumu pileringi ulke tenga purumu.
  boj-boj: Onaqa Yesus a dena walwelosiqa qure beiq di brantosiqa Juda naŋgo Qotei
    tal miligiq gilej.
  eng-DRA: And when he has passed from thence, he came into their synagogues.
  knf-knf: Yeŧu awoona da, aşë ya du *katoh kañehanaani.
  san-KHM: អនន្តរំ ស តត្ស្ថានាត៑ ប្រស្ថាយ តេឞាំ ភជនភវនំ ប្រវិឞ្ដវាន៑, តទានីម៑ ឯកះ
    ឝុឞ្កករាមយវាន៑ ឧបស្ថិតវាន៑។
  arn-NT: Fey Jesus tripatulu tiye mew, konpuy kiñe sinagoga mew mülelu tiyechi lelfün
    mew.
  zas-NT: Chi gudëd gojc zian, dxel baza Jesús abiꞌ guyuman lën tijb yadoo na̱j niz
    yagaj.
  ken-NT: Yesu arɔk ɛtɔk ɛ́chák achwe amɛm ɛkɛrɛ́ nɛnɨkɨ́mʉɛtí ɛyap.
